import logo from './logo.svg';
import './App.css';
import TestInfo from './Components/TestInfo';
import DataProvider from './Context/DataContext';

function App(props) {
  return (

    <DataProvider>

      <div className="App">
        <h2>App </h2>
        <TestInfo />
      </div>
      </DataProvider>

  );
}

export default App;
